import { FullScreenContainer } from "../common/loginsignupstyles"
import {AppDiv,CenterAppbar,StyledImage,StyledLink} from "../common/Dashboardmain.styles"
import {CardInnerDiv,CardOuterDiv} from "./Dashboard.styles"
import tataimage from "../../assets/pngs/Final logo - Tata motors .png"
import photo from "../../assets/logos/Logo_with_text.svg"
import berrysimage from "../../assets/pngs/Berrys.png";
import proto from "../../assets/pngs/Proto.png";
import CardComponent from './DashboardComponents/CardComponent';
import { useState,useEffect } from "react"
import { Grid,Alert,CircularProgress } from "@mui/material"
import axios from "axios"

interface Product {
  _id: string;
  BuyerName: string;
  SellerName: string;
  UnitPrice: number;
  TotalUnits: number;
  Tenure: number;
  DiscountRate: number;
  Xirr: number;
}
const cardsData=[{
    id:1,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000", 
    Repayment:"52,883",
    xirr:"15.29%",
    totalunit:"1000",

    remainingunit:"234",
    tenure:"60"

},{ 
    id:2,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Proto D Industries",  
    imageSeller:proto,
    unitcost:"10,000",
    Repayment:"52,883",
    xirr:"15.09%",
    totalunit:"500",
    remainingunit:"134", 
    tenure:"60"

},
{   
    id:3,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000",
    Repayment:"52,883",
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"
},
{   
    id:4,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000",
    Repayment:"52,883",
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"
},{ 
    id:5,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000",
    Repayment:"52,883",
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"
},{
    id:6,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000",
    Repayment:"52,883",
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"
}]

export const Dashboard = ( ) => {
  const [products, setProducts] = useState<Product[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  const fetchProducts = async () => {
    try {
      const response = await axios.get('http://localhost:8000/api/v1/products', { withCredentials: true });
      console.log(response.data.data);
      if (response.data && response.data.data) {
        setProducts(response.data.data);
      } else {
        setError('No products found');
      }
    } catch (err) {
      console.error(err);
      setError('Error fetching products');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchProducts();
  }, []);

  if (loading) {
    return (
      <Grid container justifyContent="center" alignItems="center" style={{ height: '100vh' }}>
        <CircularProgress />
      </Grid>
    );
  }

  if (error) {
    return (
      <Grid container justifyContent="center" alignItems="center" style={{ height: '100vh' }}>
        <Alert severity="error">{error}</Alert>
      </Grid>
    );
  }
    return (
      <FullScreenContainer>
        <AppDiv>
            <StyledImage src={photo}></StyledImage>
          <CenterAppbar>
            
          </CenterAppbar>
          <div>
            <StyledLink to="/signup"> Logout</StyledLink>
            
            
            
            {/* here i will add the functionality of sign out */}
          </div>
          
        </AppDiv>

        <CardOuterDiv>
        {cardsData.map((card) => (
        <CardComponent
          id={card.id}
          imageBuyer={card.imageBuyer}
          buyer={card.buyer}
          seller={card.seller}
          imageSeller={card.imageSeller}
          unitcost={card.unitcost}
          repayment={card.Repayment}
          xirr={card.xirr}
          totalunit={card.totalunit}
          remainingunit={card.remainingunit}
          tenure={card.tenure}
        //   onBuyNow={handleBuyNow}

        />
      ))}
        </CardOuterDiv>
      </FullScreenContainer>
    );
  };
